import React from 'react';
import ReactDOM from 'react-dom';

ReactDOM.render(
    <>
        <p style={fontSize='24px'}>Hi, it's Yash Pandey here.</p>
        <ol>
            <li>Dark Batman</li>
            <li>Yash Pandey</li>
            <li>Ak47</li>
        </ol>
    </>
    ,document.getElementById('root')
);
